import React from "react";

export default function Navbar()
{
    return(
        <navbar className="mynav">
        <h1 >VIBE</h1>
        <input type="text" placeholder="Search"></input>
        <ul className="mynav-list">
            <li>About</li>
            <li>Contact</li>
        </ul>
        </navbar>
    )
}
